import React from 'react';
import { Input } from 'antd';
import '../../../components/movies.css';
const { Search } = Input;
function Searchmovie() {
	return (
		<Search className="Search" placeholder="input search text" enterButton="Search" size="large" loading={false} />
	);
}

export default Searchmovie;
